import { Wrapper } from "../components/Layouts/";
import { H4 } from "../components/Typography/index";
import styled from "styled-components";

export default () => {
  return (
    <Wrapper>
      <HeroSection>
        <H4>
          My name is Georgemaine Lourens and I’m a product designer at Pitch.
          I’m passionate about creating delightfull digital products and
          promotion video’s. Outside of work I love buying plants and traveling
          to different countries.
        </H4>
      </HeroSection>
    </Wrapper>
  );
};

export const HeroSection = styled.section`
  background-color: #000;
  text-align: center;
  min-height: 660px;
  height: 93vh;
`;
